import React from 'react';

export const About = ({ post }) => {
    return (
      <>
        <h4>About this launch</h4>
        <div className="about">
          <div>Upvotes <br/>{post?.votesCount}</div>
          <div>Comments <br/> {post?.commentsCount}</div>
          <div>Views <br/> {post?.votesCount}</div>
          <div>Daily Rank <br/> {post?.dailyFeedPosition}</div>
          <div>Weekly Rank <br/> {post?.weeklyFeedPosition}</div>
        </div>
      </>
    )
}
